contracts/GetOracleAddress.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IOraclize {
    function requestBytes32(string memory _path) external returns (bytes32);
}

contract MyContract {
    IOraclize public oracle;

    constructor(address _oracleAddress) {
        oracle = IOraclize(_oracleAddress);
    }

    function getOracleData() public returns (bytes32) {
        return oracle.requestBytes32("http://api.trustlesswork.com"); // Reemplaza con la URL real del or√°culo
    }
}

